INSERT INTO `Consigne` (`Id`, `Titulo`, `Descripcion`, `TituloEN`, `DescripcionEN`, `Foto`, `Foto2`) VALUES
(1, 'CONSIGNE SU INMUEBLE', '<p><strong>Si usted quiere vender alg&uacute;n inmueble de manera r&aacute;pida y rentable no busque m&aacute;s. Col&oacute;quelo en nuestras manos y recibir&aacute; de inmediato:</strong></p>\r\n\r\n<p>&raquo; Visita de uno de nuestros asesores para el levantamiento de la informaci&oacute;n necesaria para su promoci&oacute;n. Realizaci&oacute;n de un registro fotogr&aacute;fico para promocionarlo efectivamente.</p>\r\n\r\n<p>&raquo; Desarrollo de un estudio de mercado teniendo en cuenta variables como tipo de inmueble, caracter&iacute;sticas, ubicaci&oacute;n, uso y precios de la zona para as&iacute; establecer y aconsejarle el precio m&aacute;s adecuado para su inmueble.</p>\r\n\r\n<p>&raquo; Publicaci&oacute;n de su inmueble en&nbsp;<strong>www.domainmobiliaria.com</strong>&nbsp;y nuestras redes sociales, entre otros.</p>\r\n\r\n<p>&raquo; Promoci&oacute;n de su inmueble a trav&eacute;s de nuestra red de inmobiliarias aliadas aumentando as&iacute; la probabilidad de contacto con posibles clientes.</p>\r\n', 'ALLOCATE YOUR PROPERTY', '<p><strong>If you want to sell a property quickly and profitably look no further. Place it in our hands and receive immediately:</strong></p>\r\n\r\n<p>&quot;Visit one of our advisors for lifting the information necessary for promotion. Making a photographic record to promote it effectively.</p>\r\n\r\n<p>&quot;Development of a market study taking into account variables such as property type, characteristics, location, use and prices in the area in order to establish and advise the most appropriate price for your property.</p>\r\n\r\n<p>&quot;Publication of your property in www.domainmobiliaria.com and our social networks, among others.</p>\r\n\r\n<p>&quot;Promotion of your property through our network of allied estate thus increasing the likelihood of contact with potential customers.</p>\r\n', '1.png', '1.jpg');
INSERT INTO `ConsigneInicio` (`Id`, `Titulo`, `TituloEN`, `Descripcion`, `DescripcionEN`, `Foto`) VALUES
(1, 'CONSIGNE SU INMUEBLE', 'CONSIGN YOUR PROPERTY', 'Si usted quiere vender o arrendar algún inmueble de manera rápida y rentable no busque más.', 'If you want to sell or lease any property quickly and profitably look no further.', '1.jpg');
INSERT INTO `Contacto` (`Id`, `Titulo`, `Subtitulo`, `Descripcion`, `TituloEN`, `SubtituloEN`, `DescripcionEN`, `Foto`, `Foto2`) VALUES
(1, '¿TIENES PREGUNTAS?', 'DETALLES DE CONTACTO', '<p>Nuestro domicilio comercial est&aacute; en la&nbsp;<strong>Carrera 25 No. 1&ordf; Sur &ndash; 155, Oficina 1352, Ed Platinum.</strong></p>\r\n\r\n<p>Si tuvieran alguna inquietud por favor comunicarse al&nbsp;<strong>444 9106 - 320 697 7900</strong>&nbsp;o a info@domainmobiliaria.com, no duden en contactarnos ya que estamos muy interesados por hacer negocios con ustedes.</p>\r\n', 'DO YOU HAVE QUESTIONS?', 'CONTACT DETAILS', '<p>Our business address is in the <strong>Carrera 25 No. 1st South - 155, Office 1352, Ed Platinum.</strong></p>\r\n\r\n<p>If you have any questions please contact at <strong>444 9106 - 320 697 7900</strong> or info@domainmobiliaria.com, please contact us as we are very interested in doing business with you.</p>\r\n', '1.jpg', '1.jpg');
INSERT INTO `Empresa` (`Id`, `Titulo`, `Descripcion`, `TituloEN`, `DescripcionEN`, `Foto`) VALUES
(1, 'DOMA INMOBILIARIA', '<h3>Nuestra Empresa</h3>\r\n\r\n<p><strong>Un doma&nbsp;</strong>es un estado sublime de bienestar, de ah&iacute; nuestro nombre, somos una empresa inmobiliaria dedicada a buscar tanto para nosotros, como para nuestros clientes y aliados, confianza, seguridad y el logro de sus intenciones de compra. Tenemos experiencia, hemos afinado nuestro ojo para conocer a nuestros clientes y poder ofrecerles siempre un servicio acorde a sus necesidades, gustos y aspiraciones. En nuestro trabajo somos puntuales, asertivos, acertados, &aacute;giles, abiertos, alegras, singulares, recursivos, prudentes y siempre honestos.</p>\r\n\r\n<p>Trabajamos de la mano de otras empresas y personas que se dedican al negocio inmobiliario, de esta manera estamos siempre actualizados en lo que est&aacute; sucediendo y podemos conseguir lo que buscamos.</p>\r\n\r\n<p>Aunque nuestro trabajo actual se centra principalmente en el valle de aburra y oriente antioque&ntilde;o, estamos siempre abiertos a buscar, recibir y trabajar con personas y propiedades de todas partes.</p>\r\n', 'DOMA INMOBILIARIA', '<h3>OUR COMPANY</h3>\r\n\r\n<p>A Doma is a sublime welfare state, hence our name, we are a real estate company dedicated to search both for us and for our customers and partners, trust, security and achieving their purchase intentions. We have experience, we have refined our eye to meet our customers and to always offer a service according to their needs, tastes and aspirations. In our work we are punctual, assertive, successful, agile, open, glad, unique, resourceful, wise and always honest.</p>\r\n\r\n<p>We work closely with other companies and individuals engaged in real estate business, so we are always up to date on what is happening and we can get what we want.</p>\r\n\r\n<p>Although our current work focuses mainly on the valley of boredom and eastern Antioquia, we are always open to seek, receive and work with people and properties everywhere.</p>\r\n', '1.jpg');
INSERT INTO `Equipo` (`Id`, `Nombre`, `Cargo`, `CargoEN`, `Descripcion`, `DescripcionEN`, `Foto`) VALUES
(2, 'MARIA TERESA ROBLES', 'CELULAR: 320 697 7900', 'CELL PHONE: 320 697 7900', '<p>Especializada en vivienda, casas y apartamentos.<br />\r\nAdemas en bodegas...</p>\r\n', '<p>Specializing in housing, houses and apartments.<br />\r\nAlso in cellars ...</p>\r\n', '41.jpg'),
(1, 'LUCÍA ANGEL', 'CELULAR: 310 425 7395', 'CELL PHONE: 310 425 7395', '<p><strong>Psic&oacute;loga de profesi&oacute;n, con experiencia comercial.</strong><br />\r\nMe encargo principalmente de la relaci&oacute;n con constructores, empresarios, lotes, inversionistas, proyectos nuevos, estoy disponible para cualquier tema en DOMA</p>\r\n', '<p>Psychologist by profession, with commercial experience.<br />\r\nIt mainly handles the relationship with builders, entrepreneurs, lots, investors, new projects, I am available for any topic at DOMA</p>\r\n', '42.jpg'),
(3, 'CLAUDIA SUESCUN', 'CELULAR: 313 653 0326', 'CELL PHONE: 313 653 0326', '<p>Soy la asistente administrativa, mi funcion en la oficina es responder a las llamadas que nuestros clientes nos hagan para hacer citas y brindarles la informacion necesaria de las propiedades en las que esten interesados o que deseen consignar en nuestra empresa, de manera cordial, atenta y siempre dispuesta a resolver dudas e inquietudes.</p>\r\n', '<p>I am the administrative assistant and function in the office is to answer the calls that our customers make us to make appointments and provide the necessary information on the properties in which they are interested or wishing to enter in our company, cordially, attentive and always ready to answer questions and concerns.</p>\r\n', '46.jpg');
