(1, 'Apartamento en Alto de las Palmas', 'APARTMENT IN ALTO DE LAS PALMAS', 'A100', '5', 'Medellin', 'Las Palmas', '125', 2, 3, 2, 597000000, '<p><strong>APARTA SUITE </strong></p>\r\n\r\n<p>Primer piso con deck proyectado sobre un espejo de agua, 2 alcobas, principal con ba&ntilde;o, vestier, balcon y doble pozuelo, segunda alcoba con ba&ntilde;o y vestier, biblioteca o star, ba&ntilde;o social, closet de linos, salon comedor amplio con chimenea, puerta de entrada del apartamento con reconocimineto facial, vidrios insonorizados y termicos.</p>\r\n', '<p>APART SUITE</p>\r\n\r\n<p>First floor deck projected onto a mirror of water, 2 bedrooms, main bathroom, closet, balcony and double cockpit, second bedroom with bathroom and dressing room, library or star, guest bathroom, linen closet, spacious living room with fireplace, door apartment entrance with facial recognized individual, soundproof glass and thermal.</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7932.79107795305!2d-75.55632057580029!3d6.211450047890887!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e44282183787e6d%3A0xde1153355e72373d!2sAltos+del+Poblado%2C+Medell%C3%ADn%2C+Antioquia%2C+Colombia!5e0!3m2!1ses!2sit!4v1464971793547" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '6.238269', '-75.564491', 0, 0),
(3, 'Apartamento en Bello', 'APARTMENT IN BELLO', 'A102', '5', 'Bello', 'Niquia', '67.29', 3, 2, 1, 175000000, '<p>3 alcobas, 2 ba&ntilde;os, estudio, cocina integral, garaje (11,50 m), cuarto util (3,45 m), sala-comedor, balcon, ultimo piso con doble altura-posibilidad de mezanine- techos en tablilla de zapan. Red de gas, porteria, piscinas, sauna, turco, minimercado y gimnasio.</p>\r\n', '<p>3 bedrooms, 2 bathrooms, study, kitchen, garage (11,50 m), fourth useful (3.45 m), living room, balcony, top floor with double-height ceilings mezanine- possibility Zapan tablet. Gas network, porter, swimming pools, sauna, steam, convenience store and gym.</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3965.575350710109!2d-75.56577698522743!3d6.319375027255861!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e442f1abd8bc64d%3A0xab5a4c01a925d03b!2sSal%C3%B3n+del+Reino+de+los+Testigos+de+Jehov%C3%A1+barrio+Las+Caba%C3%B1as!5e0!3m2!1ses!2sit!4v1464971895547" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '6.336678', '-75.561105', 0, 0),
(4, 'Apartamento en Bello', 'APARTMENT IN BELLO', 'A103', '5', 'Bello', 'Niquia', '75,40', 3, 2, 1, 195000000, '<p>3 alcobas, principal con vestier, 2 ba&ntilde;os, estudio, cocina integral, garaje (11,50 m), cuarto util (3,45 m), sla-comedor, balcon, ultimo piso con doble altura-posibilidad de mezanine- techos en tablilla de zapan.</p>\r\n\r\n<p>Red de gas, porteria, piscinas, sauna, turco, minimercado y gimnasio.</p>\r\n', '<p>3 bedrooms, main with walk in closet, 2 bathrooms, study, kitchen, garage (11,50 m), fourth useful (3.45 m), sla-room, balcony, top floor with double-height ceilings possibility mezanine- Zapan tablet.</p>\r\n\r\n<p>Gas network, porter, swimming pools, sauna, steam, convenience store and gym.</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3965.575350710109!2d-75.56577698522743!3d6.319375027255861!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e442f1abd8bc64d%3A0xab5a4c01a925d03b!2sSal%C3%B3n+del+Reino+de+los+Testigos+de+Jehov%C3%A1+barrio+Las+Caba%C3%B1as!5e0!3m2!1ses!2sit!4v1464971895547" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '6.336678', '-75.561105', 0, 0),
(5, 'Apartamento en Cantagirone', 'APARTMENT IN CANTAGIRONE', 'A104', '5', 'Medellin', 'El Poblado', '318', 3, 4, 0, 1390000000, '<p>3 alcobas con ba&ntilde;o y vestier, sal&oacute;n doble, comedor, biblioteca, dos balcones, ba&ntilde;o social, alcoba de servicio con ba&ntilde;o, cocina con isla</p>\r\n', '<p>3 bedrooms with bathroom and dressing, double living room, dining room, library, two balconies, guest bathroom, bedroom with bath, kitchen with island</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d31731.648798151225!2d-75.58198673165793!3d6.203406977058438!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e4428299a208b6f%3A0xdf22185e8e9c170d!2sEl+Poblado%2C+Medell%C3%ADn%2C+Antioquia%2C+Colombia!5e0!3m2!1ses!2sit!4v1464972290848" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '6.195327', '-75.570539', 0, 0),
(7, 'Apartamento en Cartagena de Indias', 'APARTMENT IN CARTAGENA DE INDIAS', 'A105', '5', 'Cartagena de Indias', 'Los Morros', '135', 2, 0, 1, 670000000, '<p><strong>Sector Los Morros </strong></p>\r\n\r\n<p>D&uacute;plex, 2 alcobas, sal&oacute;n, comedor, balc&oacute;n, terraza con jacuzzi y vista al mar. Unidad ubicada cerca al Hotel Las Am&eacute;ricas en sector de alta valorizaci&oacute;n; con salida directa al mar</p>\r\n', '<p>Sector Los Morros</p>\r\n\r\n<p>Duplex, 2 bedrooms, living room, balcony, terrace with Jacuzzi and ocean views. Unit located near the Hotel Las Americas in high valorization sector; with direct access to the sea</p>\r\n', '<iframe src=https://maps.google.com/maps?q=10.461743,-75.505208&z=14&output=embed width=100% height=450 frameborder=0 style=border:0 allowfullscreen></iframe>', '10.461743', '-75.505208', 0, 0),
(224, 'FINCA EN LLANOGRANDE', 'FINCA IN LLANOGRANDE', 'C108', '7', 'RIONEGRO', 'LLANOGRANDE', '300', 0, 0, 0, 1850000000, '<p>Lote : 10.670 m</p>\r\n\r\n<p>La admon es en porteria, celadores y zonas comunes, el jardinero lo paga cada propietario.</p>\r\n\r\n<p>Administracion:$493.400.</p>\r\n\r\n<p>Predial:$1.080.380</p>\r\n', '<p>Lot: 10,670 m</p>\r\n\r\n<p>The goal is admon, orderlies and common areas, the gardener pays each owner.</p>\r\n\r\n<p>Administration: $ 493,400.</p>\r\n\r\n<p>Property Taxes: $ 1,080,380<br />\r\n&nbsp;</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d31736.659659934918!2d-75.43650638166585!3d6.119602887618913!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e46994c8caa8c93%3A0x7ac9dcf6a283547b!2sLlanogrande%2C+Rionegro%2C+Antioquia%2C+Colombia!5e0!3m2!1ses!2sit!4v1465826306352" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '', '', 0, 0),
(225, 'FINCA EN EL RETIRO', 'FINCA IN RETIREMENT', 'F109', '7', 'EL RETIRO', 'EL RETIRO', '320', 5, 6, 3, 3200000000, '<p>Lote: 30.750 m2</p>\r\n\r\n<p>casa mayordomo 130 m2</p>\r\n\r\n<p>casa: 320 m2</p>\r\n\r\n<p>5 alcobas cada una con ba&ntilde;o y vestier, ba&ntilde;o social, garaje para 3 carros, vista a la represa. Hermosa!!</p>\r\n', '<p>Lot: 30,750 m2<br />\r\n130m2 house butler<br />\r\nHouse: 320 m2<br />\r\n5 bedrooms each with bathroom and dressing room, guest bathroom, 3 car garage, overlooking the dam. Beautiful!!</p>\r\n', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15870.062381550963!2d-75.51133722299679!3d6.06097576760175!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e469ad88b01875b%3A0xf6fb1427cd59ffb0!2sRetiro%2C+Antioquia%2C+Colombia!5e0!3m2!1ses!2sit!4v1465828241164" width="600" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '', '', 0, 0),
(9, 'Apartamento en Castropol', 'APARTMENT IN CASTROPOL', 'A106', '5', 'Medellin', 'El Poblado', '300', 4, 5, 2, 580000000, '<p><strong>&Aacute;rea:</strong> 300 m2</p>\r\n\r\n<p><strong>Adm&oacute;n:</strong> $890.000</p>\r\n\r\n<p><strong>Predial:</strong> $1.200.000 trim</p>\r\n\r\n<p><strong>Comodidades:</strong> un nivel, 4 alcobas con ba&ntilde;o, alcoba de servicio, 5 ba&ntilde;os, closet, biblioteca, terraza, cocina, piso en madera, zona de ropas, 2 parqueaderos y un cuarto &uacute;til, Ascensor, citofono, shut de basuras, red de gas natural, parqueadero de visitantes, sal&oacute;n social, juegos infantiles, turco y jacuzzi, porter&iacute;a 24 horas.</p>\r\n', '<p>Area: 300 m2</p>\r\n\r\n<p>Adm&oacute;n: $ 890,000</p>\r\n\r\n<p>Property Taxes: $ 1,200,000 trim</p>\r\n\r\n<p>Facilities: one level, 4 bedrooms with bathroom, service bedroom, 5 bathrooms, closet, library, terrace, kitchen, wood floor, laundry area, 2 parking and utility room, Elevator, citofono, shut garbage, network natural gas, visitor parking, social lounge, playground, steam and jacuzzi, 24-Hour goal.</p>\r\n', '<iframe src=https://maps.google.com/maps?q=6.202084,-75.567825&z=14&output=embed width=100% height=450 frameborder=0 style=border:0 allowfullscreen></iframe>', '6.202084', '-75.567825', 0, 0),
