(5, 1, '2015-11-18 21:49:12', '2015-11-18 21:49:12', '[text* text-970 class:wpcf7-form-control class:wpcf7-text class:wpcf7-validates-as-required class:form-control placeholder "Nombre"]\r\n[email* email-422 class:wpcf7-form-control class:wpcf7-text class:wpcf7-email class:wpcf7-validates-as-required class:wpcf7-validates-as-email class:form-control placeholder "E-mail"]\r\n[tel tel-680 class:wpcf7-form-control class:wpcf7-text class:wpcf7-tel class:wpcf7-validates-as-required class:wpcf7-validates-as-tel class:form-control placeholder "Telefono"]\r\n[text* text-985 class:wpcf7-form-control class:wpcf7-text class:wpcf7-validates-as-required class:form-control placeholder "Asunto"]\r\n[textarea textarea-345 class:form-control placeholder "Mensaje"]\r\n\r\n[submit id:EnviarMensaje class:wpcf7-form-control class:wpcf7-submit class:btn class:btn-primary "Enviar Mensaje"]\n[text-985]\n[text-970]\nDe: [text-970] <[email-422]>\r\n\r\nTelefono: [tel-680]\r\n\r\nAsunto: [text-985]\r\n\r\nCuerpo del mensaje:\r\n[textarea-345]\r\n\r\n--\r\nEste mensaje se ha enviado vía formulario de contacto desde Doma Inmobiliaria\njlara@webevolution.com.co\nReply-To: [email-422]\n\n\n\n\n[your-subject]\nDoma Inmobiliaria <wordpress@207.7.80.63>\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n--\r\nEste mensaje se ha enviado vía formulario de contacto desde Doma Inmobiliaria (http://207.7.80.63/~domainmobiliaria/web)\n[your-email]\nReply-To: info@juanalejandro.com\n\n\n\nSu mensaje se ha enviado con éxito. Muchas gracias.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nOcurrió un error de validación. Por favor, confirme los campos y envíe el formulario de nuevo.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nPor favor, acepte los términos y condiciones para continuar.\nPor favor, complete el campo requerido.\nEsta entrada es demasiado grande.\nEsta entrada es demasiado corta.\nEl formato de fecha no parece válido.\nFecha demasiado temprana.\nFecha demasiado tardía.\nFalló la carga del archivo.\nNo se permite este format de archivo.\nEste archivo es demasiado grande.\nFalló la carga del archivo. Ocurrió un error.\nEl formato de número no parece válido.\nNúmero demasiado bajo.\nNúmero demasiado alto.\nLa respuesta es incorrecta.\nLa dirección no parece válida.\nLa URL no parece válida.\nEl número de teléfono no parece válido.', 'Contacto', '', 'publish', 'closed', 'closed', '', 'formulario-de-contacto-1', '', '', '2015-12-16 20:45:18', '2015-12-16 20:45:18', '', 0, 'http://207.7.80.63/~domainmobiliaria/web/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpcf7_contact_form', '', 0),
