(87, 1, '2015-11-23 15:22:06', '2015-11-23 15:22:06', '<div class="col-lg-4">\r\n<img class="alignnone size-full wp-image-17" src="http://207.7.80.63/~domainmobiliaria/web/wp-content/uploads/2015/11/02_slider.png" alt="02_slider" width="100%"  /></div>\r\n\r\n\r\n<div class="col-lg-8"><h3>Nuestra Empresa</h3>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</div>\r\n\r\n', 'EMPRESA', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2015-11-23 15:22:06', '2015-11-23 15:22:06', '', 25, 'http://207.7.80.63/~domainmobiliaria/web/2015/11/23/25-revision-v1/', 0, 'revision', '', 0),
