(101, 1, '2015-11-23 15:53:13', '2015-11-23 15:53:13', '<img src="http://207.7.80.63/~domainmobiliaria/web/wp-content/uploads/2015/11/02_slider.png" alt="02_slider" width="100%" class="alignnone size-full wp-image-17" />\r\n\r\n<H3>DOMA INMOBILIARIA</H3>\r\n\r\nSomos una compañía dedicada al Negocio Inmobiliario, a la venta de propiedades en el Valle de aburra y en el Valle de San Nicolás en Rionegro, especialmente. Tenemos alianzas con inmobiliarios de Bogotá y de la Costa Atlántica y con el resto del País.\r\nEn nuestra compañía siempre estamos al tanto de las nuevas reglamentaciones del sector, cambios de los Planes de Ordenamiento Territoriales, tendencias y en general con todo lo relacionado con el sector.\r\nPertenecemos a la Lonja de Propiedad Raíz de Medellín y trabajamos en coordinación con ella.\r\nNuestro primordial objetivo es satisfacer los gustos y las necesidades de todos nuestros clientes, para lo cual hacemos un cuidadoso examen de cada uno de ellos, de su experiencia, del modo de vida, sea personal o empresarial, de la visión y objetivos de su solicitud, para ello trabajamos en alianza con un grupo de   diferentes asesores y empresas del mundo inmobiliario lo que ha constituido una herramienta fundamental para hacer de las personas de  DOMA Inmobiliaria atentas, cuidadosas, responsables, con capacidad negociadora, recursivas, con competencias comerciales y con el reconocimiento de la  novedad cuando de propiedades e inmuebles se trata.\r\nTenemos contacto con las más prestigiosas firmas promotoras y constructoras lo cual nos proporcionan un amplio conocimiento y posibilidad de ofrecer un interesante portafolio de inmuebles con la mejor selección de propiedades, proyectos nuevos y usados para la venta en vivienda, comercio e industria.', 'EMPRESA', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2015-11-23 15:53:13', '2015-11-23 15:53:13', '', 25, 'http://207.7.80.63/~domainmobiliaria/web/2015/11/23/25-revision-v1/', 0, 'revision', '', 0),
