(86, 1, '2016-02-02 15:29:23', '2016-02-02 15:29:23', '<img class="alignnone size-full wp-image-121" src="http://207.7.80.63/~domainmobiliaria/web/wp-content/uploads/2015/11/empresa.jpg" alt="empresa" width="100%" />\n<h3><strong>DOMA INMOBILIARIA</strong></h3>\n\n<p align="justify">U<span style="text-transform:lowercase;">N DOMA ES UN ESTADO SUBLIME DE BIENESTAR, DE AHÍ NUESTRO NOMBRE, SOMOS UNA EMPRESA INMOBILIARIA DEDICADA A BUSCAR TANTO PARA NOSOTROS, COMO PARA  NUESTROS CLIENTES Y ALIADOS, CONFIANZA, SEGURIDAD Y EL LOGRO DE SUS INTENCIONES DE COMPRA.</span>\n</p>\n\n<p align="justify">T<span style="text-transform:lowercase;">ENEMOS EXPERIENCIA, HEMOS AFINADO NUESTRO OJO PARA CONOCER A NUESTROS CLIENTES Y PODER OFRECERLES SIEMPRE UN SERVICIO ACORDE A SUS NECESIDADES, GUSTOS Y ASPIRACIONES.</span>\n \n</p>\n<p align="justify">E<span style="text-transform:lowercase;">N NUESTRO TRABAJO SOMOS PUNTUALES, ASERTIVOS, ACERTADOS, ÁGILES, ABIERTOS, ALEGRAS, SINGULARES, RECURSIVOS, PRUDENTES Y SIEMPRE HONESTOS.</span>\n \n</p>\n\n\n<p align="justify">T<span style="text-transform:lowercase;">RABAJAMOS DE LA MANO DE OTRAS EMPRESAS Y PERSONAS QUE SE DEDICAN AL NEGOCIO INMOBILIARIO, DE ESTA MANERA ESTAMOS SIEMPRE ACTUALIZADOS EN LO QUE ESTÁ SUCEDIENDO Y PODEMOS CONSEGUIR LO QUE BUSCAMOS.  </span>\n \n</p>\n\n\n<p align="justify">A<span style="text-transform:lowercase;">UNQUE NUESTRO TRABAJO ACTUAL SE CENTRA PRINCIPALMENTE EN EL VALLE DE ABURRA Y ORIENTE ANTIOQUEÑO, ESTAMOS SIEMPRE ABIERTOS A BUSCAR, RECIBIR Y TRABAJAR CON PERSONAS Y PROPIEDADES DE TODAS PARTES.  </span>\n \n</p>\n', 'EMPRESA', '', 'inherit', 'closed', 'closed', '', '25-autosave-v1', '', '', '2016-02-02 15:29:23', '2016-02-02 15:29:23', '', 25, 'http://207.7.80.63/~domainmobiliaria/web/2015/11/23/25-autosave-v1/', 0, 'revision', '', 0),
