(84, 1, '2015-11-20 22:04:30', '2015-11-20 22:04:30', '[select* menu-129 class:btn class:dropdown-toggle "Apartamento" "Casa" "Local" "Bodega" "Lote" "Finca"] \r\n\r\n[text* text-210 class:wpcf7-form-control class:wpcf7-text class:wpcf7-validates-as-required class:form-control placeholder "Nombres y Apellidos"]\r\n\r\n[email* email-888 class:wpcf7-form-control class:wpcf7-text class:wpcf7-email class:wpcf7-validates-as-required class:wpcf7-validates-as-email class:form-control placeholder "E-mail"]\r\n\r\n[tel* tel-563 class:wpcf7-form-control class:wpcf7-text class:wpcf7-tel class:wpcf7-validates-as-required class:wpcf7-validates-as-tel class:form-control placeholder "Telefono"]\r\n\r\n[tel* tel-859 class:wpcf7-form-control class:wpcf7-text class:wpcf7-tel class:wpcf7-validates-as-required class:wpcf7-validates-as-tel class:form-control placeholder "Celular"]\r\n\r\n[text* text-186 class:wpcf7-form-control class:wpcf7-text class:wpcf7-validates-as-required class:form-control placeholder "Ciudad"]\r\n\r\n[text* text-51 class:wpcf7-form-control class:wpcf7-text class:wpcf7-validates-as-required class:form-control placeholder "Barrio"]\r\n\r\n<p>Horario de contacto</p></br> [select menu-714 class:wpcf7-form-control class:wpcf7-select class:wpcf7-validates-as-required class:btn class:dropdown-toggle "A cualquier hora" "Mañana" "Tarde " "Noche"]\r\n\r\n[submit class:wpcf7-form-control class:wpcf7-submit class:btn class:btn-primary "Enviar Mensaje"]\nConsignar Inmueble\n[text-210] <wordpress@207.7.80.63>\nDe: [text-210] <[email-888]>\r\n\r\nAsunto: Consignar Inmueble \r\n\r\nTipo: [menu-129]\r\n\r\nTelefono de Contacto:  [tel-563]\r\n\r\nCelular: [tel-859]\r\n\r\nCiudad: [text-186]\r\n\r\nBarrio: [text-51]\r\n\r\nHora de Contacto: [menu-714]\r\n\r\n\r\n--\r\nEste mensaje se ha enviado vía formulario de contacto desde Doma Inmobiliaria (http://207.7.80.63/~domainmobiliaria/web)\njlara@webevolution.com.co\nReply-To: [email-888]\n\n\n\n\n[your-subject]\nDoma Inmobiliaria <w