(105, 1, '2015-11-23 16:15:34', '2015-11-23 16:15:34', '<img src="http://207.7.80.63/~domainmobiliaria/web/wp-content/uploads/2015/11/02_slider.png" alt="02_slider" width="100%" class="alignnone size-full wp-image-17" />\r\n\r\n<H3>DOMA INMOBILIARIA</H3>\r\n\r\n<P align="justify">Somos una compañía dedicada al Negocio Inmobiliario, a la venta de propiedades en el Valle de aburra y en el Valle de San Nicolás en Rionegro, especialmente. Tenemos alianzas con inmobiliarios de Bogotá y de la Costa Atlántica y con el resto del País.\r\nEn nuestra compañía siempre estamos al tanto de las nuevas reglamentaciones del sector, cambios de los Planes de Ordenamiento Territoriales, tendencias y en general con todo lo relacionado con el sector.</P>\r\n\r\n<P align="justify">Pertenecemos a la Lonja de Propiedad Raíz de Medellín y trabajamos en coordinación con ella.\r\nNuestro primordial objetivo es satisfacer los gustos y las necesidades de todos nuestros clientes, para lo cual hacemos un cuidadoso examen de cada uno de ellos, de su experiencia, del modo de vida, sea personal o empresarial, de la visión y objetivos de su solicitud, para ello trabajamos en alianza con un grupo de   diferentes asesores y empresas del mundo inmobiliario lo que ha constituido una herramienta fundamental para hacer de las personas de <strong> DOMA Inmobiliaria</strong> atentas, cuidadosas, responsables, con capacidad negociadora, recursivas, con competencias comerciales y con el reconocimiento de la  novedad cuando de propiedades e inmuebles se trata.</P>\r\n\r\n<P align="justify">Tenemos contacto con las más prestigiosas firmas promotoras y constructoras lo cual nos proporcionan un amplio conocimiento y posibilidad de ofrecer un interesante portafolio de inmuebles con la mejor selección de propiedades, proyectos nuevos y usados para la venta en vivienda, comercio e industria.</P>', 'EMPRESA', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2015-11-23 16:15:34', '2015-11-23 16:15:34', '', 25, 'http://207.7.80.63/~domainmobiliaria/web/2015/11/23/25-revision-v1/', 0, 'revision', '', 0),
(106, 1, '2016-01-18 17:09:51', '2016-01-18 17:09:51', '<div class="col-lg-6">\n\n<img src="http://domainmobiliaria.com/web/wp-content/uploads/2015/11/consigne.png" alt="consigne" width="100%" height="337" class="alignnone size-full wp-image-636" />\n\n<strong>Si usted quiere vender algún inmueble de manera rápida y rentable no busque más. Colóquelo en nuestras manos y recibirá de inmediato:</strong>\n<ul>\n	<li>Visita de uno de nuestros asesores para el levantamiento de la información necesaria para su promoción. Realización de un registro fotográfico para promocionarlo efectivamente.</li>\n	<li>Desarrollo de un estudio de mercado teniendo en cuenta variables como tipo de inmueble, características, ubicación, uso y precios de la zona para así establecer y aconsejarle el precio más adecuado para su inmueble.</li>\n	<li>Publicación de su inmueble en www.domainmobiliaria.com y nuestras redes sociales y el portal de la unión inmobiliaria de Colombia entre otros.</li>\n	<li>Promoción de su inmueble a través de nuestra red de inmobiliarias aliadas aumentando así la probabilidad de contacto con posibles clientes.</li>\n</ul>\n</div>\n<div class="col-lg-6" style="padding: 35px; background-color: #f0f0f0;">[contact-form-7 id="84" title="Consigne su Inmueble"]</div>', 'CONSIGNE SU INMUEBLE', '', 'inherit', 'closed', 'closed', '', '48-autosave-v1', '', '', '2016-01-18 17:09:51', '2016-01-18 17:09:51', '', 48, 'http://207.7.80.63/~domainmobiliaria/web/2015/11/23/48-autosave-v1/', 0, 'revision', '', 0),
