(587, 1, '2015-12-15 15:31:16', '2015-12-15 15:31:16', '<strong>Si usted quiere vender o arrendar algún inmueble de manera rápida y rentable no busque más. Colóquelo en nuestras manos y recibirá de inmediato:</strong>\r\n<ul>\r\n	<li>Visita de uno de nuestros asesores para el levantamiento de la información necesaria para su promoción. Realización de un registro fotográfico para promocionarlo efectivamente.</li>\r\n	<li>Desarrollo de un estudio de mercado teniendo en cuenta variables como tipo de inmueble, características, ubicación, uso y precios de la zona para así establecer y aconsejarle el precio más adecuado para su inmueble.</li>\r\n	<li>Publicación de su inmueble en www.domainmobiliaria.com y nuestras redes sociales y el portal de la unión inmobiliaria de Colombia entre otros.</li>\r\n	<li>Promoción de su inmueble a través de nuestra red de 9 inmobiliarias aliadas aumentando así la probabilidad de contacto con posibles clientes.</li>\r\n</ul>\r\n<a class="btn btn-primary btn-xs" href="http://domainmobiliaria.com/web/consigne-su-inmueble/">Vender Inmueble</a>', 'Consigne su Inmueble', '', 'publish', 'open', 'open', '', 'consigne-su-inmueble', '', '', '2015-12-16 20:39:57', '2015-12-16 20:39:57', '', 0, 'http://207.7.80.63/~domainmobiliaria/web/?p=587', 0, 'post', '', 0),
