(187, 1, '2015-11-09 19:02:57', '2015-11-09 19:02:57', '[gallery link="none" size="full" ids="188,189,191,190,193,192,195,194"]\r\n\r\nApartamento para estrenar, en un décimo piso.\r\n\r\nTiene 2 ascensores por torre.\r\n\r\nSolo son 2 torres.\r\n\r\nNo le da el poniente.\r\n\r\nLa unidad cuenta con piscina climatizada para adultos y niños, muro para escalar y gimnasio\r\n\r\n• Área interna del apartamento de 76.66 M2\r\n\r\n• Tres Alcobas cada una con sus closets de ropa.\r\n\r\n• Alcoba principal con vestier amplio (walk in closet) y baño independiente.\r\n\r\n• Closet de Linos en alcoba principal (obra adicional)\r\n\r\n• Un baño para las otras dos alcobas y social.\r\n\r\n• Balcón (con llave para manguera – adicional)\r\n\r\n• Mueble barra que separar cocina y área social, con cajones (obra adicional)\r\n\r\n• Piso en madera laminada.\r\n\r\n• Cuarto útil generoso de 7 M2 (es de los cuartos útiles mas grandes del edificio no es el estándar que se ofrece con los otros apartamento)\r\n\r\n• Dos parqueaderos individuales.', 'Apartamento en Envigado', '', 'publish', 'closed', 'closed', '', 'apartamento-en-envigado', '', '', '2016-02-04 21:31:09', '2016-02-04 21:31:09', '', 0, 'http://207.7.80.63/~domainmobiliaria/web/?post_type=property&#038;p=187', 0, 'property', '', 0),
