(507, 1, '2015-12-11 20:23:25', '2015-12-11 20:23:25', '[gallery link="none" size="full" ids="508,509"]\r\n\r\nUna casa pricipal de un solo piso con estructura de cemento y techo de madera inmunizada de 400 M2 con 6 habitaciones,tres baños, un estadero, cocina corredores y una piscina. Casa para mayordomo, lavandería y casa de muñecas. Tiene además Pesebrera y corral con brete para manejo de ganado y bodegas.\r\n\r\n<strong>LOCALiZACIÓN </strong> Está stuada en la vereda del Salineros del corregimiento de Arma en Aguadas (Caldas) A 24 kilómetros de La pintada y a 22 Kilómetros de Aguadas, a una altura sobre el nivel del mar de 1,400 metros\r\n\r\n<strong>EXTENSIÓN </strong> Tiene 330,000 M2 o sea algo más de 51 cuadras según una medición del Banco cafetero.\r\n\r\nAreas Potreros en estrella,braquiaria, india y uribe 25 cuadras; Bosques 15 cuadras; cultivos de manadarinos 6 cuadras; edificaciones y carreteras 4 cuadras\r\n\r\n<strong>INSTALACIONES </strong>Una casa pricipal de un solo piso con estructura de cemento y techo de madera inmunizada de 400 M2 con 6 habitaciones,tre baños, un estadero, cocina corredores y una piscina. Casa para mayordomo, lavandería y casa de muñecas. Tiene además Pesebrera y corral con brete para manejo de ganado y bodegas.\r\n\r\n<strong>EXPLOTACIÓNES </strong>Ganado vacuno de levante y Ceba. 1,500 mandarinos Oneco la mitad de ellos iniciando producción este año y la otra mitad con año y medio de sembrados. Un la go de peces de 1,500 M" y siembras de pancoger.\r\n\r\nOferta La finca se entrega a puerta cerrada mediante un inventario de muebles,equipo, herramietas vajillas y menaje', 'Finca en Aguadas/Caldas', '', 'publish', 'closed', 'closed', '', 'finca-en-aguadascaldas', '', '', '2016-02-03 16:36:21', '2016-02-03 16:36:21', '', 0, 'http://207.7.80.63/~domainmobiliaria/web/?post_type=property&#038;p=507', 0, 'property', '', 0),
