(803, 1, '2015-02-03 20:51:58', '2015-02-03 20:51:58', '[gallery link="none" size="full" ids="810,809"]\r\n\r\n<strong>CAUCA VIEJO- Entre Jerico y Tarso</strong>\r\n\r\nLote en pueblo con calles empedradas, parque principal, iglesia, casa cural, trapiche y senderos ecológicos.\r\n', 'Lote en Cauca Viejo', '', 'publish', 'closed', 'closed', '', 'lote-en-cauca-viejo', '', '', '2016-02-05 20:02:28', '2016-02-05 20:02:28', '', 0, 'http://domainmobiliaria.com/web/?post_type=property&#038;p=803', 0, 'property', '', 0),
(804, 1, '2015-02-03 20:56:15', '2015-02-03 20:56:15', '[gallery link="none" size="full" ids="810,809"]\r\n\r\n<strong>ENTREBOSQUES LA LUZ - 2 k.m. de la Fe hacia El Retiro</strong>\r\n\r\nLas cuotas de admon incluyen $75,000 de cuota extra para el mantenimiento de las vias. Los dueños pagan con el 15% de descuento por pronto pago y les otorga el beneficio de reforestación. Se va a pavimentar los primeros 1.200m2 de vias, esta cuota es asumida x los propietarios. $65.000/m2\r\n\r\n<strong>Admon:</strong> 296.000\r\n\r\n<strong>Predial:</strong> 1''930.000 anual\r\n\r\n\r\n\r\n', 'Lote en el Retiro', '', 'publish', 'closed', 'closed', '', 'lote-en-el-retiro-2', '', '', '2016-02-05 20:06:43', '2016-02-05 20:06:43', '', 0, 'http://domainmobiliaria.com/web/?post_type=property&#038;p=804', 0, 'property', '', 0),
(805, 1, '2015-02-03 21:04:17', '2015-02-03 21:04:17', '[gallery link="none" size="full" ids="810,809"]\r\n\r\n<strong> BOGOTA-BARRIO LOS ROSALES</strong>\r\n\r\n2 habitaciones, principal con vestier, baño y bañera, biblioteca, balcon, calefaccion, puerta blindada, 2 garajes paralelos, chimenea gas, agua caliente, sala, comedor.\r\n\r\nCuenta con piscina de entrenamiento, cancha de squash, gimnasios, turco, sauna, lavanderia, precio de los 2 parqueaderos incluido util.\r\n\r\n\r\n', 'Apartamento en los Rosales', '', 'publish', 'closed', 'closed', '', 'apartamento-en-los-rosales', '', '', '2016-02-04 21:32:55', '2016-02-04 21:32:55', '', 0, 'http://domainmobiliaria.com/web/?post_type=property&#038;p=805', 0, 'property', '', 0),
