(812, 1, '2016-02-03 22:06:53', '2016-02-03 22:06:53', '[gallery link="none" size="full" ids="810,809"]\n\n<strong>Sector Los Morros \n</strong>\nDúplex, 2 alcobas, salón, comedor, balcón, terraza con jacuzzi y vista al mar. Unidad ubicada cerca al Hotel Las Américas en sector de alta valorización; con salida directa al mar\n', 'Apartamento en Cartagena de Indias', '', 'inherit', 'closed', 'closed', '', '795-autosave-v1', '', '', '2016-02-03 22:06:53', '2016-02-03 22:06:53', '', 795, 'http://domainmobiliaria.com/web/2016/02/03/795-autosave-v1/', 0, 'revision', '', 0),
